    imprimir() {
        this.nomina = [''];
        this.imponibles = [''];
        this.noImponibles = [''];
        this.descuentos = [''];
        this.ingNo = 0;
        this.ingIm = 0;
        this.desc = 0;
        this.totalIn = 0;
        this.totalPago = 0;
        $("#parametros").show();
        $("#rolDetalle").hide();
    }
    obtenerMeses() {
        for (let mes in Meses) {
            if (isNaN(Number(mes))) {
                this.meses.push({ text: mes, value: Meses[mes] });
            }
        }
        this.mesActual = Number(((new Date).getMonth()) + 1).toString();
    }
    obtenerInformacion() {
        this.inPer = localStorage.getItem('codPer');
        this.inPer = CryptoJS.AES.decrypt(this.inPer.toString(), 'eeasaPer').toString(CryptoJS.enc.Utf8);
        this.informacion = [''];
        this.sisgerhService.obternerInformacionPer(this.inPer).subscribe(res => {
            this.informacion = res;
            this.informacion = this.informacion[0];
        });
    }
    obtenerNomina() {
        this.inAnio = Number($("#inAnio").val());
        this.inMes = Number($("#inMes").val());
        if (this.inAnio == this.anio && this.inMes > this.mesActual) {
            Swal.fire({
                icon: 'error',
                title: 'Error',
                text: 'Mes seleccionado fuera de límite'
            });
        }
        else if (this.inAnio == 0 || this.inAnio > this.anio) {
            Swal.fire({
                icon: 'error',
                title: 'Error',
                text: 'Año incorrecto'
            });
        }
        else {
            $("#parametros").hide();
            $("#rolDetalle").show();
            this.nomina = [''];
            this.sisgerhService.obtenerNomina(this.inPer, this.inAnio, this.inMes).subscribe(res => {
                this.nomina = res;
            });
        }
    }
    obtenerIngresos(val) {
        let valor = this.nomina.find((s) => s.DNMPN_CODIGO == val);
        if (valor)
            this.nombreNomina = valor.DNMPN_NOMBRE_NOMINA;
        this.ingIm = 0;
        this.ingNo = 0;
        this.desc = 0;
        this.totalIn = 0;
        this.totalPago = 0;
        this.resultadoNom = $("#sltNomina").val();
        this.imponibles = [''];
        this.noImponibles = [''];
        this.descuentos = [''];
        this.sisgerhService.obtenerRol('obtenerImponibles', this.resultadoNom, this.inPer).subscribe(res => {
            this.imponibles = res;
            for (const i in this.imponibles) {
                this.ingIm += parseFloat(this.imponibles[i].DNMNC_VALOR);
            }
            //  
            //  console.log(this.ingIm)
        });
        this.sisgerhService.obtenerRol('obtenerNoImponibles', this.resultadoNom, this.inPer).subscribe(res => {
            this.noImponibles = res;
            for (const i in this.noImponibles) {
                this.ingNo += parseFloat(this.noImponibles[i].DNMNC_VALOR);
            }
            let total = this.ingIm + this.ingNo;
            this.ingNo = Math.round(this.ingNo * 100) / 100;
            this.ingIm = Math.round(this.ingIm * 100) / 100;
            this.totalIn = Math.round(total * 100) / 100;
        });
        this.sisgerhService.obtenerRol('obtenerDescuentos', this.resultadoNom, this.inPer).subscribe(res => {
            this.descuentos = res;
            for (const i in this.descuentos) {
                this.desc += parseFloat(this.descuentos[i].DNMNC_VALOR);
            }
            let liq = this.totalIn - this.desc;
            this.desc = Math.round(this.desc * 100) / 100;
            this.totalPago = Math.round(liq * 100) / 100;
        });
